import React, { useState, useEffect } from "react";
import axios from "axios";

function ShowFeedback() {
  const [feedbackData, setFeedbackData] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await fetch(
        "https://railwaymcq.com/student/dbfeedback_api.php"
      );

      if (!response.ok) {
        throw new Error("Failed to fetch data");
      }
      const data = await response.json();
      console.log(data);
      setFeedbackData(data); // Assuming setFeedbackData is defined elsewhere
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  return (
    <div>
      <h1>Feedback</h1>
      <div>
        {feedbackData.map((feedback, index) => (
          <div key={index}>
            <p>Serial: {feedback.serial}</p>
            <p>Zone: {feedback.zone}</p>
            <p>Division: {feedback.division}</p>
            <p>Department: {feedback.deptt}</p>
            <p>Date: {feedback.date}</p>
            <p>Message: {feedback.message}</p>
            <hr />
          </div>
        ))}
      </div>
    </div>
  );
}

export default ShowFeedback;
